And operator in MongoDB to perform query with multi-filters using the official .NET driver<p>I am using MongoDB 3.2 and I want to make a query from C# using the official .NET <a href="https://docs.mongodb.com/ecosystem/drivers/csharp/" rel="noreferrer">driver</a> (2.6)</p>

<p>Use Robomongo to perform the search, and the correct query is:</p>

<pre><code>db.getCollection('collection1').find({ $and: [ { type: "ws128" }, { tsend: { $gte: ISODate("2018-05-11T14:39:33.000Z"), $lt: ISODate("2018-05-11T14:39:40.000Z") } }  ] })
</code></pre>

<p>I want to find all the documents that have the key <strong>type = ws128</strong> and that the variable <strong>tsend is between the two dates</strong> that are shown in the query.</p>

<p>In C #, I have the filters defined as shown below but I do not know how to do the query:</p>

<pre><code>DateTime datetimestart =  new DateTime(2018, 5, 11, 14, 39, 33);
DateTime datetimeend =  new DateTime(2018, 5, 11, 14, 39, 40);
var filter1 = Builders&lt;BsonDocument&gt;.Filter.Eq("type", "ws128");
var filter2 = Builders&lt;BsonDocument&gt;.Filter.Gte("tsend", datetimeend);
var filter3 = Builders&lt;BsonDocument&gt;.Filter.Lt("tsend", datetimestart);
</code></pre>

<p>With a single filter, the search performed without problems as shown below, but I do not know how to include the 3 filters.</p>

<pre><code>var cursor = collection.Find(filter1).ToCursor();
</code></pre>

<p>Can someone guide me to continue?
Thank you!
regards,</p>

