How to query $regex on embedded documents to count distinct values<p>I have a collection with documents in the following format:</p>

<pre><code>{ 
    "_id" : ObjectId("abc"), 
    "mobile" : "123456789", 
    "channels" : [
        {
            "name" : "email.xz", 
            "type" : "a", 
            "properties" : [
                {
                    "provider" : "outlook"
                }
            ]
        }, 
        {
            "name" : "sms", 
            "type" : "sms"
            }
    ], 

}
</code></pre>

<p>I need to find customers who have at least one channel which the name ends with ".xz", but only if provider exists and has a value, and return the count of customers per channel. For instance:</p>

<pre><code>email.xz = 10
sms.xz = 5
push.xz = 7
</code></pre>

<p>I tried to use the aggregate function below, but it resulted in a count of all the customers that match the criteria.</p>

<pre><code>db.consumers.aggregate(
{$match: {"channels.name": {$regex: ".xz$"}, 
"notificationChannels.properties.provider": { $exists: true }}},
{$group: {_id: "channels.name"},
count: {$sum: 1}})
</code></pre>

Expires setting in mongoose schema is ignored if index already exists at MongoDB<p>I'm using the <code>expires</code> field in a <a href="http://mongoosejs.com/" rel="nofollow noreferrer">mongoose</a> schema in order to set expiration on a given field. For instance:</p>

<pre><code>var Crumbs = new Schema({
    ...
    timestamp: {
      type: Date,
      expires: 3600,
      required: true
    },
    ...
});
</code></pre>

<p>The effect is the expected one and the following index is created at MongoDB <em>if the index doesn't previously exist</em>:</p>

<pre><code>&gt; db.crumbs.getIndexes()
[
    ...
    {
        "v" : 2,
        "key" : {
            "timestamp" : 1
        },
        "name" : "timestamp_1",
        "ns" : "mydb.crumbs",
        "expireAfterSeconds" : 36000,
        "background" : true
    }
]
</code></pre>

<p>However, if the index previously exists it is not created. For instance, if I change to <code>expires: 360</code> in my code and I re-run my program, <code>"expireAfterSeconds"</code> at MongoDB keeps being <code>36000</code>.</p>

<p>Is there any way to force the index to use the value defined in the schema, even if the index already exists?</p>

