Spring Data MongoDb - Criteria equivalent to a given query that uses $expr<p>I have a collection with documents like this:</p>

<pre><code> {
    "_id" : ObjectId("5a8ec4620cd3c2a4062548ec"),
    "start" : 20,
    "end" : 80
 }
</code></pre>

<p>and I want to show the documents that overlap a given percentage (50%) with an interval (startInterval = 10, endInterval = 90).</p>

<p>I calculate the overlaping section with the following formula:</p>

<pre><code>min(end , endInterval) - max(start, startInterval ) / (endInterval - startInterval)
</code></pre>

<p>In this example:
min(80,90) - max(20,10) / (90-10) = (80-20)/80 = 0.75 --> 75%
Then this document will be shown, as 75% is greater than 50%</p>

<p>I expressed this formula in mongo shell as:</p>

<pre><code>db.getCollection('variants').find(
  {
     $expr: {  

       $gt: [

              { 
                $divide: [
                           { 
                             $subtract: [ 
                                          { $min: [ "$end", endInterval ]  }
                                          , 
                                          { $max: [ "$start", startInterval ]  } 
                             ] 
                           }
                           , 
                           { $subtract: [ endInterval, startInterval ] }
                         ] 
              }
             , 
             overlap 
            ]
      }
  }
)
</code></pre>

<p>where</p>

<p>overlap = 0.5, startInterval = 10 and endInterval= 90</p>

<p>It works fine in mongo shell.</p>

<p>I'm asking for an equivalent way to calculate this using Spring Data Criteria, since the $expr functionality I used in mongo shell is still to be implemented in Spring Data Mongo.
Currently I'm using Spring Boot 2.0.0, Spring Data MongoDb 2.0.5 and mongodb 3.6.</p>

<p>Thanks a lot for your time. </p>

